import React from "react";
import { MDBInput, MDBBtn } from "mdb-react-ui-kit";

function ContactForm(){
    return <div>
        <h1 className="mt-4">- Contact -</h1>

        <form id="contactForm" className="mt-4 text-center">  
            <MDBInput type="email" placeholder="Email adress" v-model="email" wrapperClass="mb-4"  />
            <MDBInput placeholder="Subject" v-model="subject" wrapperClass="mb-4"  />
        </form>
    </div>
}

export default ContactForm
